import React from "react";
import record from "./db.json";
const Home = () => {
  console.log(record);
  return (
    <>
      <div
        style={{
          border: "2px solid black",
          width: "50%",
          height: "50vh",
          margin: "auto",
          display:"flex"
        }}
      >
        <h4 style={{flex}}>Time</h4>
        {record.map((val, index) => {
          return <p>{val.data[index].time} </p>;
        })}
        {record.map((value) => {
          return <p>{value.name}</p>;
        })}
      </div>
    </>
  );
};

export default Home;
